import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>TEAM MAMIO </h1>

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
        <p>Welcome to **Bot Battlr**, the one and only spot in the known universe where you can custom build your own Bot Army! This is our app</p>
        </a>
      </header>
    </div>
  );
}

export default App;
